import React from 'react';

function Developers({ onBack }) {
  const showAniketInfo = () => {
    alert("üî∑ ùóú Hey, my name is Aniket Mishra. Transform ideas into seamless digital experiences. üí°");
  };

  const showAnshulInfo = () => {
    alert("üî∑ ùóú Hey, my name is Anshul Sharma. I blend logic with creativity to build impactful digital solutions. üí°");
  };

  const showAmiteshInfo = () => {
    alert("üî∑ ùóú Hey, my name is Amitesh Dwivedi. Enthusiastics about tech that empowers people. üí°");
  };

  return (
    <div className="min-h-screen bg-gray-100">
      {/* Header */}
      <div className="relative">
        <img src="/images/banner1.jpg" alt="Banner" className="w-full h-32 object-cover" />
        <div className="absolute top-0 left-0 w-full h-full flex items-center justify-between px-4 bg-opacity-50 bg-black">
          <button onClick={onBack} className="bg-gray-500 text-white px-4 py-2 rounded">
            Back Home
          </button>
          <h1 className="text-3xl font-bold text-white">Developer Panel</h1>
          <div></div>
        </div>
      </div>

      {/* Main Content */}
      <div className="relative">
        <img src="/images/develop.jpg" alt="Background" className="w-full h-screen object-cover absolute top-0 left-0 z-0" />
        <div className="relative z-10 flex justify-center gap-8 pt-20">
          {/* Aniket Mishra */}
          <div className="flex flex-col items-center">
            <button onClick={showAniketInfo} className="w-52 h-52 bg-gray-300 flex items-center justify-center">
              <img src="/images/aniket.jpg" alt="Aniket Mishra" className="w-full h-full object-cover" />
            </button>
            <button onClick={showAniketInfo} className="mt-4 w-52 bg-white text-blue-900 font-bold py-2">
              ANIKET MISHRA
            </button>
          </div>

          {/* Anshul Sharma */}
          <div className="flex flex-col items-center">
            <button onClick={showAnshulInfo} className="w-52 h-52 bg-gray-300 flex items-center justify-center">
              <img src="/images/anshul.jpeg" alt="Anshul Sharma" className="w-full h-full object-cover" />
            </button>
            <button onClick={showAnshulInfo} className="mt-4 w-52 bg-white text-blue-900 font-bold py-2">
              ANSHUL SHARMA
            </button>
          </div>

          {/* Amitesh Dwivedi */}
          <div className="flex flex-col items-center">
            <button onClick={showAmiteshInfo} className="w-52 h-52 bg-gray-300 flex items-center justify-center">
              <img src="/images/amitesh.jpg" alt="Amitesh Dwivedi" className="w-full h-full object-cover" />
            </button>
            <button onClick={showAmiteshInfo} className="mt-4 w-52 bg-white text-blue-900 font-bold py-2">
              AMITESH DWIVEDI
            </button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Developers;
